import mongoose from "mongoose";

const vetSchema = mongoose.Schema({
    fullName: {
        type: String,
        required: true,
    },
    email: {
        type: String,
        required: true,
        unique: true
    },
    password: {
        type: String,
        required: true
    },
    gender: {
        type: String,
        enum: ["male", "female"]
    },
    image: {
        type: String,
        default: "data:image/jpeg;base64,",
    },
    speciality: {
        type: String,
    },
    about: {
        type: String,
    },
    fees: {
        type: Number,
    },
    degree: {
        type: String,
    },
    experience: {
        type: Number,
    },
    date: {
        type: Number,
    },
    slots_book: {
        type: Object,
        default: {},
        required: false
    }
}, { minimize: false })

export const Vet = mongoose.model("Vet", vetSchema);